import React from 'react';

const Navigation = () => {
    return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
            <button className="f5 dark-gray pv2 ph3 bg-white hover-bg-near-white ba b--moon-gray br2 shadow-1 pa3 pointer">Sign Out</button>
        </nav>
    );
}

export default Navigation;
